"c2c-migrations-preflight-check-errors.duplicate-groups-check.failed-content.explanation-for-failure":"Fusionaremos los usuarios que pertenezcan a grupos de este sitio con grupos que tengan los mismos nombres en tu sitio de destino. Esto puede provocar que algunos de tus usuarios reciban permisos no deseados, ya que heredar\xe1n los permisos de los grupos a los que se a\xf1adan. Desc\xe1rgate el archivo CSV para ver los grupos afectados. Si no quieres a\xf1adir usuarios autom\xe1ticamente a los grupos, selecciona {boldTagStart}Migrar los usuarios y grupos por separado{boldTagEnd} en el paso anterior.",
"c2c-migrations-preflight-check-errors.duplicate-groups-check.failed-content.explanation-for-warning":"Fusionaremos los usuarios que pertenezcan a grupos de este sitio con grupos que tengan los mismos nombres en tu sitio de destino. Dado que los permisos para los grupos de ambos sitios son los mismos, la fusi\xf3n de los grupos no provocar\xe1 cambios en los permisos. No hace falta que realices ninguna acci\xf3n y puedes continuar con la migraci\xf3n. Descarga el archivo CSV para ver qu\xe9 grupos se ven afectados. Si no quieres a\xf1adir usuarios a grupos autom\xe1ticamente, vuelve al paso anterior y selecciona {boldTagStart}Migrar los usuarios y grupos por separado{boldTagEnd}. A continuaci\xf3n, volveremos a ejecutar las comprobaciones.","c2c-migrations-preflight-check-errors.duplicate-groups-check.failed-content.learn-how-we-migrate-link":"M\xe1s informaci\xf3n sobre la migraci\xf3n de grupos",
