"polaris-lib-project-access.edition-info.edition-info-modal.content-beta-info":"\n        <p>\n            Jira Product Discovery es <b>actualmente gratis durante la fase beta</b>, \n            pero se convertir\xe1 en un producto de pago m\xe1s adelante, con ediciones Free y Standard. \n            Solo se cobrar\xe1 a los <b>creadores</b> del plan Standard. \n            Encontrar\xe1s m\xe1s informaci\xf3n en el <announcement>anuncio del modelo de precios</announcement>. \n        </p>\n        <p>\n            Durante la fase beta, el producto no comprueba los accesos, \n            lo que significa que los usuarios sin acceso al producto pueden actuar como creadores. \n            Una vez que decidas pasar a la edici\xf3n Free o Standard, esto dejar\xe1 de ser as\xed. \n            Te avisaremos con antelaci\xf3n.\n        </p>",
"polaris-lib-project-access.edition-info.edition-info-modal.content-user-types":"\n        <p>\n            Jira Product Discovery admite dos tipos de usuarios, que un administrador del sitio configura en el <directory>directorio</directory>:\n            <ul>\n                <li>\n                    <b>Creadores</b>: usuarios con acceso al producto Jira Product Discovery (usuarios con licencia). \n                    Pueden utilizar todas las funciones seg\xfan el acceso que tengan en cada proyecto.\n                </li>\n                <li>\n                    <b>Colaboradores</b>: los usuarios sin acceso al producto Jira Product Discovery se conocen como colaboradores (usuarios sin licencia). \n                    Solo pueden utilizar un subconjunto de funciones; por ejemplo, ideas abiertas y vistas en modo de solo lectura \n                    con la posibilidad de votar y comentar.\n                </li>\n            </ul>\n        </p>",
