"project-template-select-v2.utils.categories.category-legal-description":"Obt\xe9n visibilidad y control sobre tus procesos legales. Gestiona informaci\xf3n cr\xedtica y garantiza que se realicen actualizaciones con nuestras plantillas para los equipos del departamento legal.","project-template-select-v2.utils.categories.category-legal-title":"Asuntos legales","project-template-select-v2.utils.categories.category-made-for-you-description":"Plantillas para ti basadas en c\xf3mo trabajan equipos similares.","project-template-select-v2.utils.categories.category-made-for-you-title":"Hechas para ti","project-template-select-v2.utils.categories.category-marketing-description":"Independientemente de si es un \xfanico blog o toda una campa\xf1a de correo electr\xf3nico, convierte tus ideas en publicaciones con nuestras plantillas de marketing.","project-template-select-v2.utils.categories.category-marketing-title":"Marketing",
