"project-template-select-v2.utils.categories.product-management-description":"Gu\xeda cada paso del ciclo de vida de un producto: desde el principio hasta la entrega, c\xe9ntrate en el producto y sus clientes antes que nada con nuestras plantillas de gesti\xf3n de productos.","project-template-select-v2.utils.categories.product-management-title":"Gesti\xf3n de productos","project-template-select-v2.utils.products.product-core-description":"Conecta tus equipos y herramientas. Empieza a supervisar, coordinar y gestionar el trabajo de forma organizada y coherente con nuestras plantillas de gesti\xf3n del trabajo.","project-template-select-v2.utils.products.product-core-title":"Jira Work Management","project-template-select-v2.utils.products.product-customer-service-description":"Servicio de atenci\xf3n al cliente de Jira.","project-template-select-v2.utils.products.product-customer-service-title":"Servicio de atenci\xf3n al cliente de Jira",
