"project-template-select-v2.utils.templates.business.asset-creation.value-prop-1-description":"Mant\xe9n las prioridades organizadas y consulta de forma clara todo el trabajo del equipo en una sola vista. Ordena por prioridad y gestiona las fechas de vencimiento de todo el trabajo entrante en una ubicaci\xf3n compartida.","project-template-select-v2.utils.templates.business.asset-creation.value-prop-1-title":"Centralizaci\xf3n de las cuestiones de los activos entrantes","project-template-select-v2.utils.templates.business.asset-creation.value-prop-2-description":"Al utilizar formularios, aseg\xfarate de que figure toda la informaci\xf3n necesaria, como los requisitos y las especificaciones, y est\xe9 lista para que el equipo trabaje con ella. Dedica menos tiempo a perseguir a las partes interesadas en busca de informaci\xf3n para poder centrarte en lo importante.",
