"project-template-select-v2.utils.templates.business.blank-project.value-prop-2-description":"Prioriza, programa y asigna cada encargo para que puedas ver con facilidad qui\xe9n es el propietario de la tarea, comprobar el estado y colaborar con tus compa\xf1eros de equipo.","project-template-select-v2.utils.templates.business.blank-project.value-prop-2-title":"Facilitar la colaboraci\xf3n","project-template-select-v2.utils.templates.business.blank-project.value-prop-3-description":"Gracias a las vistas de listas, calendarios, tableros y cronogramas, cada miembro del equipo se podr\xe1 centrar en el estado de sus tareas individuales, a la vez que mantiene a las partes interesadas al tanto de la evoluci\xf3n del proyecto.","project-template-select-v2.utils.templates.business.blank-project.value-prop-3-title":"Diversas formas de visualizar el trabajo","project-template-select-v2.utils.templates.business.budget-creation.approval":"Aprobaci\xf3n",
