"project-template-select-v2.utils.templates.customer-service.customer-service-management.value-prop-1-description":"Ofrece a los clientes una experiencia fluida de principio a fin con un portal intuitivo, sencillo y con imagen de marca que les facilite obtener ayuda r\xe1pidamente y que permita a tus equipos optimizar el trabajo que llegue.","project-template-select-v2.utils.templates.customer-service.customer-service-management.value-prop-1-title":"Lleva tu marca a tu portal","project-template-select-v2.utils.templates.customer-service.customer-service-management.value-prop-2-description":"Tu cola re\xfane solicitudes de correo electr\xf3nico, herramientas de chat, tu proyecto de asistencia y otros canales para ayudarte a supervisar, clasificar y asignar las solicitudes entrantes.","project-template-select-v2.utils.templates.customer-service.customer-service-management.value-prop-2-title":"Optimiza la cola",
"project-template-select-v2.utils.templates.customer-service.customer-service-management.value-prop-3-description":"Eval\xfaa la satisfacci\xf3n del cliente y mejora su experiencia de asistencia con los acuerdos de nivel de servicio (SLA). Haz un seguimiento de los plazos seg\xfan el tiempo transcurrido o las categor\xedas de solicitudes, y usa alertas y notificaciones automatizadas para evitar las infracciones.","project-template-select-v2.utils.templates.customer-service.customer-service-management.value-prop-3-title":"Mejora de la satisfacci\xf3n del cliente","project-template-select-v2.utils.templates.customer-service.emailed-request":"Solicitud por correo electr\xf3nico","project-template-select-v2.utils.templates.customer-service.pending":"Pendiente","project-template-select-v2.utils.templates.done":"Listo","project-template-select-v2.utils.templates.epic":"Epic","project-template-select-v2.utils.templates.improvement":"Mejora",
