"project-template-select-v2.utils.templates.service-desk.analytics-service-management.value-prop-2-description":"Ayuda a tu equipo a recopilar, clasificar y asignar el trabajo entrante reuniendo las solicitudes de m\xfaltiples canales como el correo electr\xf3nico, las herramientas de chat y los portales. Utiliza los flujos de trabajo para seguir el progreso y las colas para ayudar a organizar las solicitudes por prioridad y ver en qu\xe9 est\xe1n trabajando los dem\xe1s.","project-template-select-v2.utils.templates.service-desk.analytics-service-management.value-prop-2-title":"Gestiona solicitudes con facilidad",
