"project-template-select-v2.utils.templates.service-desk.design-service-management.value-prop-2-description":"Clasifica, prioriza y establece acuerdos de nivel de servicio para que tu equipo pueda hacer un seguimiento de las solicitudes importantes. Utiliza las reglas de automatizaci\xf3n para informar a los miembros del equipo si las solicitudes son urgentes y automatiza las aprobaciones y la forma en que asignas la responsabilidad de tareas espec\xedficas para ahorrarle tiempo al equipo.","project-template-select-v2.utils.templates.service-desk.design-service-management.value-prop-2-title":"Consigue un ritmo de trabajo fluido",
"project-template-select-v2.utils.templates.service-desk.design-service-management.value-prop-3-description":"Fomenta el autoservicio creando una base de conocimientos para compartir los recursos m\xe1s solicitados, como las \xfaltimas directrices de dise\xf1o, plantillas, kits de presentaci\xf3n y archivos de activos. Incluye respuestas a preguntas habituales para que los empleados puedan encontrar ayuda sin tener que enviar una solicitud.","project-template-select-v2.utils.templates.service-desk.design-service-management.value-prop-3-title":"Fomenta el autoservicio","project-template-select-v2.utils.templates.service-desk.emailed-request":"Solicitud por correo electr\xf3nico","project-template-select-v2.utils.templates.service-desk.facilities-service-management.recommended-list":"Equipos de instalaciones que necesitan una forma m\xe1s sencilla de supervisar el trabajo y gestionar las solicitudes de los empleados",
