"project-template-select-v2.utils.templates.service-desk.facilities-service-management.value-prop-1-title":"Gesti\xf3n del talento con facilidad","project-template-select-v2.utils.templates.service-desk.facilities-service-management.value-prop-2-description":"Proporciona a tus empleados un lugar \xfanico para registrar las incidencias de mantenimiento con el fin de reducir los peligros del lugar de trabajo. Informa a tus empleados de cualquier riesgo importante a\xf1adiendo un mensaje en el portal para empleados.","project-template-select-v2.utils.templates.service-desk.facilities-service-management.value-prop-2-title":"Control de los peque\xf1os percances",
"project-template-select-v2.utils.templates.service-desk.facilities-service-management.value-prop-3-description":"Las solicitudes de acci\xf3n informan de manera r\xe1pida y precisa sobre el progreso para que puedas celebrar el \xe9xito de tu equipo y mejorar tu servicio. Crea paneles e informes personalizados a fin de realizar un seguimiento del tipo y la frecuencia de los incidentes, de modo que puedas reducir las incidencias y ver el valor que tu equipo aporta a la organizaci\xf3n.","project-template-select-v2.utils.templates.service-desk.facilities-service-management.value-prop-3-title":"Aumenta la excelencia de tu equipo","project-template-select-v2.utils.templates.service-desk.finance-service-management.recommended-list":"Equipos financieros que buscan un lugar centralizado para el seguimiento y la gesti\xf3n de solicitudes",
"project-template-select-v2.utils.templates.service-desk.finance-service-management.request-type-budget-allocation":"Solicitar una asignaci\xf3n presupuestaria","project-template-select-v2.utils.templates.service-desk.finance-service-management.request-type-policy-review":"Solicitar una revisi\xf3n de la pol\xedtica","project-template-select-v2.utils.templates.service-desk.finance-service-management.request-type-questions-for-finance":"Preguntas para finanzas","project-template-select-v2.utils.templates.service-desk.finance-service-management.value-prop-1-description":"Facilita a los empleados el env\xedo de solicitudes y a tu equipo su priorizaci\xf3n, seguimiento y gesti\xf3n mediante flujos de trabajo y colas que respalden tus procesos. Automatiza la gesti\xf3n de solicitudes sencillas o habituales, para que tu equipo pueda dedicar m\xe1s tiempo a las tareas importantes.",
"project-template-select-v2.utils.templates.service-desk.finance-service-management.value-prop-1-title":"Impulsa la eficiencia operativa","project-template-select-v2.utils.templates.service-desk.finance-service-management.value-prop-2-description":"Crea un espacio seguro para que los equipos financieros puedan gestionar las solicitudes confidenciales y compartir la informaci\xf3n con confianza. Protege la privacidad de tus empleados y mant\xe9n la confidencialidad de la informaci\xf3n utilizando permisos para gestionar qui\xe9n puede ver, buscar y comentar las solicitudes.","project-template-select-v2.utils.templates.service-desk.finance-service-management.value-prop-2-title":"Comparte informaci\xf3n de forma segura",
"project-template-select-v2.utils.templates.service-desk.finance-service-management.value-prop-3-description":"Utiliza una ubicaci\xf3n central para compartir el progreso de las solicitudes en tiempo real, promover procesos coherentes y establecer expectativas con las partes interesadas y los aprobadores. Fomenta la colaboraci\xf3n con los empleados y los partners comerciales mediante el uso de flujos de trabajo compartidos, tipos de solicitudes adaptados y plantillas de formularios.","project-template-select-v2.utils.templates.service-desk.finance-service-management.value-prop-3-title":"Fomenta la colaboraci\xf3n entre equipos","project-template-select-v2.utils.templates.service-desk.general-service-management-for-business-new.recommended-list":"Cualquier equipo empresarial que desee gestionar las solicitudes de asistencia","project-template-select-v2.utils.templates.service-desk.general-service-management-for-business-new.request-type-1":"Plantear una pregunta",
