"project-template-select-v2.utils.templates.service-desk.general-service-management-for-business-new.value-prop-2-description":"Ahorra tiempo a tu equipo automatizando las aprobaciones y la forma de asignar la responsabilidad de las tareas simples o repetitivas. Ofrece un portal de autoservicio que proporcione acceso a la informaci\xf3n y las directrices m\xe1s recientes, para que los empleados puedan encontrar lo que necesitan sin tener que enviar una solicitud.","project-template-select-v2.utils.templates.service-desk.general-service-management-for-business-new.value-prop-2-title":"Resuelve las solicitudes m\xe1s r\xe1pidamente",
"project-template-select-v2.utils.templates.service-desk.general-service-management-for-business-new.value-prop-3-description":"Utiliza los informes y los paneles para dar visibilidad a la prioridad y el estado de las solicitudes, y para medir tu impacto. Utiliza estas m\xe9tricas para identificar las eficiencias, de modo que puedas optimizar y ajustar el valor que tu equipo aporta a la organizaci\xf3n.","project-template-select-v2.utils.templates.service-desk.general-service-management-for-business-new.value-prop-3-title":"Aumenta la excelencia de tu equipo","project-template-select-v2.utils.templates.service-desk.general-service-management-for-business.recommended-list":"Equipos empresariales que buscan gestionar de forma eficaz las solicitudes de asistencia","project-template-select-v2.utils.templates.service-desk.general-service-management-for-business.request-type-1":"Plantear una pregunta",
