"project-template-select-v2.utils.templates.service-desk.hr-service-management.request-type-4":"Preguntas para RR.\xa0HH.","project-template-select-v2.utils.templates.service-desk.hr-service-management.value-prop-1-description":"Gestiona las idas y venidas del personal como un equipo con una herramienta centralizada que te ayuda a colaborar con los equipos de TI, finanzas, n\xf3minas e instalaciones, entre otros, para aportar a los empleados una experiencia fluida. Aumenta el nivel de tus flujos de trabajo mediante automatizaciones para que tus procesos puedan escalarse al ritmo que t\xfa lo hagas.","project-template-select-v2.utils.templates.service-desk.hr-service-management.value-prop-1-title":"Gestiona de forma eficaz las incorporaciones de empleados y las salidas de los que dejan la empresa",
"project-template-select-v2.utils.templates.service-desk.hr-service-management.value-prop-2-description":"Ayuda a los equipos de RR.\xa0HH. a gestionar las solicitudes confidenciales con seguridad. Crea un espacio seguro para documentar y supervisar los casos confidenciales de relaciones con los empleados mediante permisos que permitan gestionar qui\xe9n puede ver, buscar y comentar las solicitudes.","project-template-select-v2.utils.templates.service-desk.hr-service-management.value-prop-2-title":"Mant\xe9n la seguridad con la gesti\xf3n de casos de RR.\xa0HH.",
"project-template-select-v2.utils.templates.service-desk.hr-service-management.value-prop-3-description":'Ayuda a tu personal a encontrar respuestas a preguntas comunes utilizando tu portal de asistencia. Configura una base de conocimientos mediante <a href="https://www.atlassian.com/software/confluence" target="_blank">Confluence</a> para mostrar art\xedculos relevantes antes de que tus empleados env\xeden solicitudes, de forma que puedan obtener la ayuda que necesitan sin tener que recurrir a un agente de asistencia.',"project-template-select-v2.utils.templates.service-desk.hr-service-management.value-prop-3-title":"Facilita el autoservicio","project-template-select-v2.utils.templates.service-desk.investigate-a-problem":"Investigar un problema","project-template-select-v2.utils.templates.service-desk.it-independent-service-management.recommended-list-1":"Equipos que quieren controlar sus procesos de gesti\xf3n de servicios en un espacio independiente",
"project-template-select-v2.utils.templates.service-desk.it-independent-service-management.request-type-1":"Solicitud de una nueva cuenta","project-template-select-v2.utils.templates.service-desk.it-independent-service-management.value-prop-1-description":'Colabora y resuelve incidencias m\xe1s r\xe1pido que nunca. Proporciona a las personas adecuadas toda la informaci\xf3n que necesitan para actuar y aprende de las incidencias y, as\xed, evitar que vuelvan a suceder en el futuro.<br /><a href="https://support.atlassian.com/jira-service-management-cloud/docs/learn-about-the-it-service-management-template/" target="_blank">Si buscas funciones de ITSM m\xe1s potentes, prueba nuestra nueva plantilla de gesti\xf3n de servicios de TI</a>',"project-template-select-v2.utils.templates.service-desk.it-independent-service-management.value-prop-1-title":"Resoluci\xf3n de incidentes y correcci\xf3n de incidencias cr\xedticas",
"project-template-select-v2.utils.templates.service-desk.it-independent-service-management.value-prop-2-description":"Esta plantilla, que se basa en las pr\xe1cticas recomendadas de ITIL, est\xe1 dise\xf1ada para ayudarte a trabajar de forma m\xe1s eficaz en todos los equipos con el fin de atender las solicitudes de asistencia r\xe1pidamente. Los agentes se apoyan en diversas funciones, como las acciones en masa y las capacidades de aprendizaje autom\xe1tico, que agrupan de manera inteligente las solicitudes parecidas.","project-template-select-v2.utils.templates.service-desk.it-independent-service-management.value-prop-2-title":"Atiende las solicitudes de asistencia r\xe1pidamente",
"project-template-select-v2.utils.templates.service-desk.it-independent-service-management.value-prop-3-description":"Eval\xfaa la satisfacci\xf3n del cliente y mejora su experiencia de asistencia con los acuerdos de nivel de servicio (SLA). Haz un seguimiento de los plazos seg\xfan el tiempo transcurrido o las categor\xedas de solicitudes, y usa alertas y notificaciones automatizadas para evitar las infracciones.","project-template-select-v2.utils.templates.service-desk.it-independent-service-management.value-prop-3-title":"Mejora de la satisfacci\xf3n del cliente","project-template-select-v2.utils.templates.service-desk.it-service-management.recommended-list-1":"Equipos de TI y DevOps","project-template-select-v2.utils.templates.service-desk.it-service-management.recommended-list-2":"Cualquier equipo que busque una soluci\xf3n de gesti\xf3n de servicios potente con funciones de gesti\xf3n de cambios e incidentes",
"project-template-select-v2.utils.templates.service-desk.it-service-management.request-type-1":"Solicitud de un cambio","project-template-select-v2.utils.templates.service-desk.it-service-management.value-prop-1-description":"Colabora en los incidentes y resu\xe9lvelos m\xe1s r\xe1pido que nunca mediante las escalaciones de 1\xa0clic a Opsgenie. En caso de que se presenten incidencias cr\xedticas, utiliza la programaci\xf3n de guardias, las alertas, la recopilaci\xf3n de incidentes y mucho m\xe1s para ofrecer a las personas adecuadas toda la informaci\xf3n que necesitan para tomar medidas.","project-template-select-v2.utils.templates.service-desk.it-service-management.value-prop-1-link":"M\xe1s informaci\xf3n sobre la gesti\xf3n de incidentes","project-template-select-v2.utils.templates.service-desk.it-service-management.value-prop-1-title":"Resuelve los incidentes m\xe1s r\xe1pidamente",
"project-template-select-v2.utils.templates.service-desk.it-service-management.value-prop-2-description":"Derriba los obst\xe1culos con los equipos de desarrollo y acelera los flujos de trabajo automatizando los cambios. Aligera la carga mediante la evaluaci\xf3n automatizada de los riesgos que suponen los cambios, flujos de trabajo de aprobaci\xf3n avanzados e integraciones con herramientas de CI y CD, como Bitbucket Pipelines, Jenkins y CircleCI.","project-template-select-v2.utils.templates.service-desk.it-service-management.value-prop-2-link":"M\xe1s informaci\xf3n sobre la gesti\xf3n de cambios","project-template-select-v2.utils.templates.service-desk.it-service-management.value-prop-2-title":"Realiza un seguimiento de los cambios y apru\xe9balos",
"project-template-select-v2.utils.templates.service-desk.it-service-management.value-prop-3-description":"Basada en las pr\xe1cticas recomendadas de ITIL, esta plantilla est\xe1 dise\xf1ada para ayudarte a trabajar de forma m\xe1s eficaz en todos los equipos con el fin de atender las solicitudes de asistencia m\xe1s r\xe1pido que nunca. Los agentes se apoyan en diversas funciones, como las acciones en masa y las capacidades de aprendizaje autom\xe1tico, que agrupan de manera inteligente las solicitudes parecidas.","project-template-select-v2.utils.templates.service-desk.it-service-management.value-prop-3-title":"Atiende las solicitudes de asistencia r\xe1pidamente","project-template-select-v2.utils.templates.service-desk.legal-service-management.recommended-list":"Equipos legales que buscan una forma clara y \xfanica de supervisar y gestionar su trabajo",
