"project-template-select-v2.utils.templates.software.scrum.value-prop-2-description":"Los sprints son breves periodos planificados durante los cuales un equipo colabora para completar una cantidad fija de valor para el cliente. Utiliza los sprints para potenciar la entrega incremental, as\xed como para permitir que tu equipo lance trabajo de excelente calidad y aporte valor con mayor rapidez.","project-template-select-v2.utils.templates.software.scrum.value-prop-2-link":"M\xe1s informaci\xf3n sobre los sprints","project-template-select-v2.utils.templates.software.scrum.value-prop-2-title":"Organiza ciclos de trabajo en sprints","project-template-select-v2.utils.templates.software.scrum.value-prop-3-description":"Mejora la predictibilidad de la planificaci\xf3n y la entrega con informes listos para usar, entre los que se incluyen el informe del sprint y el gr\xe1fico de velocidad. Capacita a tu equipo para que pueda conocer su capacidad e iterar sus procesos.",
"project-template-select-v2.utils.templates.software.scrum.value-prop-3-link":"M\xe1s informaci\xf3n acerca de las m\xe9tricas \xe1giles","project-template-select-v2.utils.templates.software.scrum.value-prop-3-title":"Conocer la velocidad de tu equipo","project-template-select-v2.utils.templates.story":"Historia","project-template-select-v2.utils.templates.sub-task":"Subtarea","project-template-select-v2.utils.templates.task":"Tarea","project-template-select-v2.utils.templates.to-do":"Pendiente","project-template-select.common.page.back-to-template":"Volver a las plantillas de proyectos","project-template-select.common.page.bread-crumbs.project-templates":"Plantillas de proyectos","project-template-select.layout.navigation.back-to-projects":"Volver a los proyectos","project-template-select.layout.navigation.category-templates":"Plantillas de proyectos","project-template-select.layout.navigation.import-project":"Importar tu trabajo",
