"project-template-select.utils.templates.service-desk.legal-service-management.value-prop-2-description":"Crea flujos de trabajo integrales y claros para realizar el seguimiento de las solicitudes de revisi\xf3n de contratos y modif\xedcalos para adaptarlos a los procesos y sistemas de tu equipo. Obt\xe9n informaci\xf3n f\xe1cilmente sobre cu\xe1ndo se aproxima la resoluci\xf3n de un contrato mediante notificaciones y estados claros del flujo de trabajo.","project-template-select.utils.templates.service-desk.legal-service-management.value-prop-2-title":"Aseg\xfarate una evoluci\xf3n fluida de los contratos","project-template-select.utils.templates.service-desk.legal-service-management.value-prop-3-description":"Crea aprobaciones automatizadas para tareas f\xe1ciles con el fin de optimizar la carga de trabajo de tu equipo. Elabora un carril r\xe1pido automatizado para tareas sencillas como la publicaci\xf3n de cartas y avisos est\xe1ndar que no requieren intervenci\xf3n humana.",
