"project-template-select.utils.templates.software.bug-tracking.full-description":"Detecta, monitoriza y resuelve errores e incidencias durante todo el proceso de desarrollo. Ofrece una \xfanica fuente fiable de todas tus incidencias y ayuda a tu equipo a establecer prioridades frente a sus objetivos generales, al tiempo que aportas valor a tus clientes de forma continua.","project-template-select.utils.templates.software.bug-tracking.recommended-list":"Equipos que detectan, hacen un seguimiento y resuelven errores","project-template-select.utils.templates.software.bug-tracking.title":"Seguimiento de errores","project-template-select.utils.templates.software.bug-tracking.value-prop-1-description":"Ve todos los errores en un solo lugar. Cuando hayas identificado un error, recoge los detalles creando una incidencia desde cualquier punto de tu proyecto. Cada tipo de incidencia \xfanico puede tener su propio flujo de trabajo personalizado.",
