"project-template-select.utils.templates.software.kanban.value-prop-1-description":"Los elementos de trabajo se representan visualmente en el tablero de kanban, lo que permite a los equipos realizar un seguimiento del estado del trabajo en cualquier momento. Las columnas de tu tablero representan cada paso del flujo de trabajo del equipo, desde lo que hay pendiente hasta lo que est\xe1 hecho.","project-template-select.utils.templates.software.kanban.value-prop-1-link":"M\xe1s informaci\xf3n sobre los tableros de kanban","project-template-select.utils.templates.software.kanban.value-prop-1-title":"Supervisa el trabajo mediante un tablero sencillo","project-template-select.utils.templates.software.kanban.value-prop-2-description":"Establece la cantidad m\xe1xima de trabajo que puede haber en cada estado mediante l\xedmites de trabajo en curso (WIP). Al limitar el trabajo en curso, puedes mejorar el enfoque del equipo e identificar mejor las deficiencias y los cuellos de botella.",
