"software-onboarding-nudges--next.kanban-onboarding-tour.board-create-column.board-create-column-nudge-content":"Tu tablero comienza con un simple flujo de trabajo de tres pasos. El trabajo se gestiona de forma abierta, por lo que todo el mundo puede seguir el estado de una tarea a medida que avanza. Cuando lo tengas todo listo para personalizar el flujo de trabajo, a\xf1ade o edita las columnas.","software-onboarding-nudges--next.kanban-onboarding-tour.board-create-issue.board-create-issue-nudge-content":'Una vez que est\xe9 configurado, empieza a identificar y a\xf1adir {tagStart}incidencias{tagEnd}, que es lo que llamamos "trabajo" en Jira. Intenta dividir el trabajo en partes de tama\xf1o uniforme, para poder estimar la complejidad y asignar las tareas con seguridad.',
