"software-onboarding-quickstart.onboarding-checklist.checklist.checklist-view.find-your-way-around.description":"Puedes empezar a trabajar en varias \xe1reas de tu proyecto. La {tagStart}hoja de ruta{tagEnd} es el lugar donde planear tus grandes objetivos y capturar las dependencias. Para el trabajo que debe definirse y priorizarse, ve a tu {tagStart}backlog{tagEnd}. Cuando el trabajo est\xe9 listo, a\xf1\xe1delo a tu {tagStart}tablero{tagEnd} para que todo el equipo pueda realizar un seguimiento de su progreso.","software-onboarding-quickstart.onboarding-checklist.checklist.checklist-view.find-your-way-around.link-aria-label":"Ver las pr\xe1cticas recomendadas de la metodolog\xeda \xe1gil en una nueva pesta\xf1a","software-onboarding-quickstart.onboarding-checklist.checklist.checklist-view.find-your-way-around.secondary-link":"Ver las pr\xe1cticas recomendadas de la metodolog\xeda \xe1gil",
