"software-onboarding-quickstart.onboarding-checklist.checklist.checklist-view.intuitive-scrum-onboarding-task.intuitive-scrum-onboarding-task-description":"Convierte estos proyectos grandes y complejos en trabajos peque\xf1os. Scrum es una forma de trabajar, empezando por tu {tagStart}backlog{tagEnd}, donde priorizas y eliges las tareas que se pueden realizar en un intervalo de tiempo limitado o en un sprint. Establece un objetivo, dale duro; luego, reflexiona, itera y vuelve a hacerlo.","software-onboarding-quickstart.onboarding-checklist.checklist.checklist-view.intuitive-scrum-onboarding-task.intuitive-scrum-onboarding-task-nudge-cta":"Mostrarme","software-onboarding-quickstart.onboarding-checklist.checklist.checklist-view.intuitive-scrum-onboarding-task.intuitive-scrum-onboarding-task-title":"Empezar con scrum","software-onboarding-quickstart.onboarding-checklist.checklist.checklist-view.invite-teammates-task.google-sync-button":"Sincronizar con Google",
