"software-onboarding-quickstart.onboarding-checklist.checklist.checklist-view.kanban-onboarding-task.kanban-onboarding-task-description":"Convierte esos proyectos confusos y lentos en un flujo de trabajo transparente y continuo. Kanban es una forma de trabajar, empezando por tu {tagStart}tablero{tagEnd}, que es donde estableces las prioridades y eliges las tareas que se ajustan a los niveles de capacidad. Crea un tablero que se adapte a tu forma de trabajar, dale duro; luego, reflexiona, itera y vuelve a hacerlo.","software-onboarding-quickstart.onboarding-checklist.checklist.checklist-view.kanban-onboarding-task.kanban-onboarding-task-description-link":"Ver gu\xeda","software-onboarding-quickstart.onboarding-checklist.checklist.checklist-view.kanban-onboarding-task.kanban-onboarding-task-description-link-aria-label":"Ver la gu\xeda en una nueva pesta\xf1a",
