"software-onboarding-quickstart.onboarding-checklist.checklist.checklist-view.map-out-your-project-goals-task.planning-basics-task-description":'Convierte esos grandes objetivos en resultados alcanzables para que tu equipo pueda sacar el trabajo adelante poco a poco. La {tagStart}hoja de ruta{tagEnd} te ayuda a planificar, supervisar y visualizar los objetivos de tu proyecto, empezando por los epics. Los epics se dividen en peque\xf1as partes de trabajo que se pueden poner en pr\xe1ctica, a las que llamamos "incidencias".',"software-onboarding-quickstart.onboarding-checklist.checklist.checklist-view.monitor-manage-risk.overview-task-description":"La gesti\xf3n del riesgo es una parte importante de la planificaci\xf3n eficaz. Y m\xe1s a\xfan si tienes todos los detalles en el mismo sitio. Utiliza la hoja de ruta para asignar dependencias, crear vistas personalizadas, filtrar y ordenar todo tu trabajo.",
