"ticket-types-config.empty-state.changes-description":'Los cambios implican a\xf1adir, modificar o eliminar cualquier elemento que pudiera repercutir en tus servicios. Entre los tipos de solicitud m\xe1s comunes se pueden incluir los siguientes: actualizar un servidor, actualizar el <em>software</em> o programar un traslado de escritorio. <a target="_blank" href="{href}">M\xe1s informaci\xf3n sobre los tipos de solicitud</a>.',"ticket-types-config.empty-state.description-changes":"Los cambios implican a\xf1adir, modificar o eliminar cualquier elemento que pudiera repercutir en tus servicios. Los tipos de solicitudes m\xe1s comunes son: actualizar un servidor, actualizar el software o programar un traslado de mesa. <link>Obt\xe9n m\xe1s informaci\xf3n sobre los tipos de solicitud</link>.",
"ticket-types-config.empty-state.description-incidents":"Los incidentes son eventos no planificados que interrumpen o reducen la calidad de tu servicio (o amenazan con hacerlo). Entre los tipos de solicitud m\xe1s comunes se pueden incluir los siguientes: informar de un problema del sistema, informar de un servicio deficiente o informar de hardware estropeado. <link>Obt\xe9n m\xe1s informaci\xf3n sobre los tipos de solicitud</link>.","ticket-types-config.empty-state.description-post-incident-reviews":"Las revisiones posteriores a los incidentes te ayudan a conocer la causa principal de estos para poder reducir la posibilidad de que se repitan. <link>Obt\xe9n m\xe1s informaci\xf3n sobre los tipos de solicitud</link>.",
"ticket-types-config.empty-state.description-problems":"Los problemas son la causa (o la posible causa) de los incidentes. Entre los tipos de solicitud m\xe1s comunes se pueden incluir los siguientes: investigar un problema, informar de un posible incidente o hacer un seguimiento de una incidencia recurrente. <link>Obt\xe9n m\xe1s informaci\xf3n sobre los tipos de solicitud</link>.","ticket-types-config.empty-state.description-service-requests":"Las solicitudes de asistencia son peticiones que hacen los usuarios de informaci\xf3n, de acceso a un servicio o de algo nuevo. Entre los tipos de solicitud m\xe1s comunes se pueden incluir los siguientes: \u201cNecesito un ordenador port\xe1til nuevo\u201d, \u201cNecesito restablecer mi contrase\xf1a\u201d o \u201c\xbfC\xf3mo puedo acceder a mi cuenta?\u201d <link>Obt\xe9n m\xe1s informaci\xf3n sobre los tipos de solicitud</link>.",
